import { Component, Vue } from 'vue-property-decorator';
import ProjectList from './components/ProjectList.vue';
import { MdContent } from 'vue-material/dist/components';

Vue.use(MdContent);

@Component({
  components: {
    ProjectList,
  },
})
export default class App extends Vue {}
